def normalize_and_find_lcs_numerical(s1_str, s2_str):
    """
    1. Converts signed/unsigned integers from strings to normalized 8-bit unsigned values (0-255).
    2. Finds the Longest Common Substring (LCS) between these two normalized sequences.
    """
    
    # 1. Conversion and Normalization Function
    def normalize_data(data_str):
        """Converts raw string of numbers (potentially signed) to a list of unsigned 8-bit integers."""
        try:
            raw_ints = [int(n) for n in data_str.split()]
        except ValueError:
            raise ValueError("Input data contains non-numeric values.")

        # Convert to unsigned 8-bit value (Two's Complement for negatives)
        # The bitwise AND with 0xFF (255) effectively handles the two's complement 
        # for signed 8-bit numbers (e.g., -65 & 0xFF -> 191).
        return [n & 0xFF for n in raw_ints]

    try:
        s1 = normalize_data(s1_str)
        s2 = normalize_data(s2_str)
    except ValueError as e:
        return str(e), 0
        
    m = len(s1)
    n = len(s2)
    
    # Dynamic Programming setup
    dp = [[0] * (n + 1) for _ in range(m + 1)]
    max_len = 0
    end_index_s1 = -1

    # 2. Build the DP table (O(m*n))
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            # Comparison happens on the normalized unsigned values (0-255)
            if s1[i - 1] == s2[j - 1]:
                dp[i][j] = dp[i - 1][j - 1] + 1
                
                if dp[i][j] > max_len:
                    max_len = dp[i][j]
                    end_index_s1 = i
            else:
                dp[i][j] = 0

    # 3. Extract the Longest Common Substring (The numerical sequence from the normalized s1)
    if max_len == 0:
        return "No common unsigned numerical substring found.", 0

    start_index = end_index_s1 - max_len
    # We return the unsigned values that formed the LCS
    result_list_unsigned = s1[start_index:end_index_s1]
    
    # OPTIONAL: Convert the unsigned numbers back to their ASCII characters for easy reading
    try:
        # Note: This step is for visualization, the core match is on the numbers
        byte_stream = bytes(result_list_unsigned)
        result_ascii = byte_stream.decode('ascii', errors='ignore')
        
        # If the output is purely printable, prioritize the text for analysis
        return f"ASCII: {result_ascii}\nNumerical: " + " ".join(map(str, result_list_unsigned)), max_len
    except:
         # Fallback to the raw numerical sequence if ASCII conversion fails
        return "Numerical: " + " ".join(map(str, result_list_unsigned)), max_len

